require('dotenv').config();
const fs = require('fs');
const path = require('path');

// HTML 파일에서 의원 사진 URL 추출
function extractPhotoUrlsFromHtml(html) {
  const photoUrls = {};
  
  // img 태그에서 alt와 src 추출
  const matches = html.matchAll(/<img[^>]*src="([^"]*)"[^>]*alt="([^"]*) 국회의원 사진"/g);
  
  // 디버깅을 위한 카운터 추가
  let count = 0;
  for (const match of matches) {
    const url = match[1];
    const name = match[2];
    photoUrls[name] = url;
    count++;
  }
  console.log(`Found ${count} photo URLs in HTML`);
  
  return photoUrls;
}

// member22.json 파일 업데이트
async function updateMemberPhotos() {
  try {
    // HTML 파일 읽기
    const htmlPath = path.join(__dirname, 'members.html');
    const html = fs.readFileSync(htmlPath, 'utf8');

    // member22.json 파일 읽기
    const jsonPath = path.join(__dirname, '../src/data/member22.json');
    const memberData = JSON.parse(fs.readFileSync(jsonPath, 'utf8'));

    console.log(`Total members in JSON: ${memberData.members.length}`);
    console.log('Extracting photo URLs from HTML...');
    const photoUrls = extractPhotoUrlsFromHtml(html);

    console.log('Updating member photos...');
    let updatedCount = 0;
    const updatedMembers = memberData.members.map(member => {
      const photoUrl = photoUrls[member.name];
      if (photoUrl) {
        updatedCount++;
        return { ...member, photoUrl };
      }
      return member;
    });

    // 업데이트된 데이터 저장
    const updatedData = { members: updatedMembers };
    fs.writeFileSync(jsonPath, JSON.stringify(updatedData, null, 2));
    
    console.log(`Successfully updated ${updatedCount} members with photo URLs`);
    
    // 업데이트되지 않은 의원 목록 출력
    const unmappedMembers = updatedMembers.filter(member => !member.photoUrl);
    if (unmappedMembers.length > 0) {
      console.log('\nWarning: Following members were not mapped:');
      unmappedMembers.forEach(member => {
        console.log(`- ${member.name} (${member.party})`);
      });
      console.log(`\nTotal unmapped members: ${unmappedMembers.length}`);
    }

    // 디버깅을 위해 추출된 URL 목록 출력
    console.log('\nExtracted photo URLs:');
    Object.entries(photoUrls).slice(0, 5).forEach(([name, url]) => {
      console.log(`${name}: ${url}`);
    });

  } catch (error) {
    console.error('Failed to update member photos:', error);
  }
}

